import React from "react";
import styles from "./App.module.css";
import { Router, Route, Switch } from "react-router-dom";

import history from "../../utils/history";

// import Torus from "../OAth";

function App() {
  return (
    <Router history={history}>
      {/* <Switch> */}
      <NavBar />
      <Route path="/practice" exact component={PracticePage} />
      <Route path="/" exact component={CorDPage} />
      <Route path="/profile" exact component={ProfilePage} />
      <Route path="/friends" exact component={FriendPage} />
      <Route path="/home" exact component={Home} />
      <Route path="/landing" exact component={LandingPage} />
      <Route path="/login" exact component={LoginPage} />
      <Route path="/signup" exact component={SignupForm} />
      <Route path="/chat" exact component={ChatPage} />
      <Route path="/web3" exact component={Web3Practice} />

      {/* <Route path="/torus" exact component={Torus} /> */}
      {/* </Switch> */}
    </Router>
  );
}

export default App;
